def main():    """    Entry point for Day 5, Part 1    601 - correct    :return: Exit code    """    ranges, ingredients = read_input('input.txt')    fresh_count = 0    for ingredient in ingredients:        fresh = False        for range_item in ranges:            if range_item[0] <= ingredient <= range_item[1]:                fresh = True                break        if fresh:            fresh_count += 1    print('Fresh count: ' + str(fresh_count))def read_input(filename):    ranges = []    ingredients = []    with open(filename, 'r') as file:        for line in file:            if '-' in line:                ranges.append(tuple(map(int, line.split('-'))))            if '-' not in line and line != '\n':                ingredients.append(int(line.strip()))    return ranges, ingredientsif __name__ == "__main__":    main()